import React, { Component } from "react";
import {BroswerRouter as Route, Link} from "react-router-dom";
import "./App.css";
import saved from "./components/pages/saved";
import search from "./components/pages/search";


class App extends Component {
  render() {
    return (
      <Route>
        <div>
          <Link exact path="/" component={search} />
          <Link exact path="/saved" component={saved} />
        </div>
      </Route>
    );
  }
}

export default App;
